import React from "react";
import SvgIcon from '@mui/material/SvgIcon';
import HotPeppericon from '../../images/googlemap.svg';

export function GoogleIcon (props) {
  return (
    <SvgIcon
      component="span"
      viewBox="0,0,100,100">
      <svg width="100" height="100" fill="none" xmlns={HotPeppericon} ></svg>
    </SvgIcon>
  );
};
